import React,{useState,useEffect} from 'react';
const myfunction=()=>
{
  const [items, setItems]=useState([]);
  useEffect(()=>{
    axios.get("localhost/hotelbackend/getdata.php").then(res=>{
      setItems(res.data);
    });
  },[]);
}
export default myfunction.items;
